import React from 'react'
import {Link} from "react-router-dom";

export default function Header() {
    return (
        <div>
            <Link style={removeDecoration} id="settings-button" to="/settings"> &#9881; </Link>

        </div>
    )
}

const removeDecoration = {
    textDecoration: "none"
}
